INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (1, 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 0.0, 102601, 24001, 24, "リン", "あたしだって\nやるときはやるよ！", 1, 0, 10040);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (1, 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 0.0, 102601, 24002, 24, "リン", "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, 1, 10040);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (1, 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 0.0, 102601, 24003, 24, "リン", "終わった終わった\n一人でもなんとか\nなるもんだね", 1, 2, 10040);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (2, 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 0.0, 102601, 24004, 24, "リン", "やったね！\nこれでようやく\nサボれるよ…", 2, 3, 10040);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (1, 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 0.0, 102601, 24005, 24, "リン", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 1, 4, 10040);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (2, 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 0.0, 102601, 24006, 24, "リン", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 2, 5, 10040);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (2, 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 0.0, 102601, 24007, 24, "リン", "あたしも意外と\nやるもんでしょ？", 2, 6, 10040);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (4, 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 0.0, 102601, 24008, 24, "リン", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 4, 7, 10040);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (4, 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 0.0, 102601, 24009, 24, "リン", "このままじゃ\nまっひ～に\n叱られちゃうよ", 4, 8, 10040);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (4, 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 0.0, 102601, 24010, 24, "リン", "まじめに\nやったんだけどな…\n悔しいな～", 4, 9, 10040);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (4, 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 0.0, 102601, 24011, 24, "リン", "やられた…\nねずみって意外と\nてごわいね", 4, 10, 10040);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (4, 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 0.0, 102601, 24012, 24, "リン", "おのれ～\nあたしのチーズを\n盗みやがって～！", 4, 11, 10040);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (4, 0.0, "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 1.81, 102601, 24013, 24, "リン", "疲れた…\nけど、次こそは\n守り抜くよ…", 1, 12, 10040);
